import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { Provider } from 'react-redux';
import { Router } from 'react-router';
import { Route, Routes } from 'react-router-dom';
import { createBrowserHistory } from 'history';
import Home from './pages/home/home';
import LatestNews from './pages/latest-news/latest-news';
import PopularNews from './pages/popular-news/popular-news';
import store from './redux/store';
import './index.css'

const root = ReactDOM.createRoot(document.getElementById('root'));
const history = createBrowserHistory();

root.render(
  <React.StrictMode>
    <Provider store={store}>
        <Router>
            <App>
                <Routes>
                    <Route  path="/" exact element={<Home />} />
                    <Route path="/latest-news" exact element={<LatestNews />} />
                    <Route path="/popular-news" exact element={<PopularNews />} />
                </Routes>
            </App>
        </Router>
    </Provider>
  </React.StrictMode>
);
